import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';

import './Contact.css';

export default props => {
    return(
        <div className="contact-page">
            <Container>
                <Row>
                    <Col xs={12} sm={12} md={12} lg={12}>
                        <h1 className="n1" style={{ textTransform: "uppercase" }}>Lichelle Gaerlan</h1>
                        <h2 className="n2">Las Vegas | Designer &amp; Developer</h2>
                        <br/><br/><br/>

                        <p>
                            If you would like to get in touch or work on a project together,
                            feel free to contact me at
                            lichellemaegaerlan@gmail.com or at (702) 302-2920
                        </p>

                        <p>
                            Github / LinkedIn / Mail / Phone
                        </p>
                    </Col>
                </Row>
            </Container>
        </div>
    );
}
